import React, { Component } from 'react';
import '../styles/api.css';

export default class Api extends Component {
    constructor(props) {
        super(props);
        this.url = 'https://randomuser.me/api/?results=10';
        this.showPerson = this.showPerson.bind(this);
        this.state = {
            data: {},
            person: {},
        };
    }

    componentDidMount() {
        this.getData();
    }

    getData() {
        fetch(this.url)
            .then(data => data.json())
            .then(res => {
                this.setState({
                    data: res.results,
                });
            })
            .catch(error => console.log(error));
    }
    showPerson() {
        const number = Math.floor(Math.random() * 10);
        this.setState({ person: this.state.data[number] });
        console.log(number);
    }

    render() {
        console.log(this.state.person);
        return (
            <section className="apiContainer">
                <h1 className="header">API</h1>
                <button onClick={this.showPerson}>Randomize Person</button>
                <div className="personDiscription">jj</div>
            </section>
        );
    }
}
